import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Set a mobile viewport to ensure the mobile menu is visible
    await page.setViewportSize({ width: 375, height: 667 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Open the mobile menu
    const menuTrigger = page.locator('div.nav-menu:has-text("All")');
    await menuTrigger.waitFor({ state: 'visible', timeout: 5000 });
    await menuTrigger.click();

    // 2. Verify the menu is open and take a screenshot
    const mobileMenuOverlay = page.locator('#mobileMenuOverlay');
    await mobileMenuOverlay.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_opened.png'));

    // 3. Click a navigation link within the menu
    const booksLink = page.locator('.mobile-menu a:has-text("Books")');
    await booksLink.waitFor({ state: 'visible', timeout: 5000 });
    await booksLink.click();

    // Take a screenshot after clicking a link
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_link_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_link_clicked.png'));

    // 4. Close the mobile menu
    const closeButton = page.locator('.mobile-menu button.close-mobile-menu');
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // 5. Verify the menu is closed and take a final screenshot
    await mobileMenuOverlay.waitFor({ state: 'hidden', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    const isMenuVisibleAfterClose = await mobileMenuOverlay.isVisible();

    return {
      success: !isMenuVisibleAfterClose,
      action: "Successfully opened, navigated, and closed the mobile menu.",
      extractedData: {
        menuOpened: await menuTrigger.isVisible(),
        menuClosed: !isMenuVisibleAfterClose
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
